import React, { useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";
import { getGithubRepos } from "../../store";
import Spinner from "../layout/Spinner";

function ProfileGithub({ username }) {
  const dispatch = useDispatch();
  useEffect(() => {
    dispatch(getGithubRepos(username));
  }, [dispatch, username]);
  const { repos } = useSelector((state) => {
    return state.profile
  })
  return <div className='text-primary my-1'>
    <h2 className="text-primary my-1">
        Github repos
    </h2>
    {repos === null ? <Spinner /> : repos.map(repo => <div key={repo._id} className="repo bg-white p-1 my-1">
    <div>
        <h4>
            <a href={repo.html_url}></a>
        </h4>
    </div>
    </div>)}
  </div>;
}

export default ProfileGithub;
